import axios from "axios";
import $ from "jquery";
export default {
    namespaced:true,
    mutations:{
        setQRCodeIdArr(state,idArr){
            state.QRCodeIdArr = idArr;
        },
        setQrCodePictureArr(state,picture){
            state.QrCodePictureArr.push(picture);
        }
    },
    actions:{
       getQRCodePictureArr(context){
        context.state.QRCodeIdArr.forEach(codeIdMap => {
            codeIdMap.cabinetId
        });
       }
    },
    state:{
       QRCodeIdArr:[],
       QrCodePictureArr:[]
    }
}
